import React, { useState } from 'react';
import axios from 'axios';

function FlightForm({ fetchFlights }) {
    const [flightNumber, setFlightNumber] = useState('');
    const [flightLength, setFlightLength] = useState('');
    const [departureTime, setDepartureTime] = useState('');
    const [departureAirportId, setDepartureAirportId] = useState('');
    const [arrivalAirportId, setArrivalAirportId] = useState('');
    const [weather, setWeather] = useState(null);
    const [flightDetails, setFlightDetails] = useState(null);

    // Funkcja do pobierania szczegółów lotu (w tym pogody)
    const fetchFlightDetails = async (flightId) => {
        try {
            const response = await axios.get(`http://localhost:8080/flights/${flightId}`);
            const flight = response.data;
            setFlightDetails(flight);
            setWeather(flight.weather); // Pobieramy dane pogodowe
        } catch (error) {
            console.error('Błąd podczas pobierania szczegółów lotu:', error);
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:8080/flights/create', {
                flightNumber,
                flightLength,
                departureTime,
                departureAirportId,
                arrivalAirportId
            });
            console.log("Lot utworzony:", response.data);
            fetchFlights(); // Odśwież listę lotów
            fetchFlightDetails(response.data.id); // Pobierz szczegóły nowo dodanego lotu
        } catch (error) {
            console.error('Błąd tworzenia lotu:', error);
        }
    };

    return (
        <div>
            <h3>Dodaj nowy lot</h3>
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    placeholder="Numer lotu"
                    value={flightNumber}
                    onChange={(e) => setFlightNumber(e.target.value)}
                    required
                />
                <input
                    type="number"
                    placeholder="Czas trwania"
                    value={flightLength}
                    onChange={(e) => setFlightLength(e.target.value)}
                    required
                />
                <input
                    type="datetime-local"
                    value={departureTime}
                    onChange={(e) => setDepartureTime(e.target.value)}
                    required
                />
                <input
                    type="number"
                    placeholder="ID lotniska odlotu"
                    value={departureAirportId}
                    onChange={(e) => setDepartureAirportId(e.target.value)}
                    required
                />
                <input
                    type="number"
                    placeholder="ID lotniska przylotu"
                    value={arrivalAirportId}
                    onChange={(e) => setArrivalAirportId(e.target.value)}
                    required
                />
                <button type="submit">Dodaj lot</button>
            </form>

            {/* Wyświetlanie szczegółów lotu i pogody */}
            {flightDetails && (
                <div className="flight-details">
                    <h4>Szczegóły lotu:</h4>
                    <p><strong>Numer lotu:</strong> {flightDetails.flightNumber}</p>
                    <p><strong>Wylot:</strong> {flightDetails.departureTime}</p>
                    <p><strong>Status:</strong> {flightDetails.status}</p>
                    <p><strong>Lotnisko odlotu:</strong> {flightDetails.departureAirport.name}, {flightDetails.departureAirport.city.name}, {flightDetails.departureAirport.city.country}</p>
                    <p><strong>Lotnisko przylotu:</strong> {flightDetails.arrivalAirport.name}, {flightDetails.arrivalAirport.city.name}, {flightDetails.arrivalAirport.city.country}</p>

                    {weather && (
                        <div className="weather-info">
                            <h4>Pogoda na lotnisku odlotu ({weather.cityName}):</h4>
                            <p><strong>Opis:</strong> {weather.description}</p>
                            <p><strong>Temperatura:</strong> {weather.temperature}°C</p>
                            <p><strong>Wiatr:</strong> {weather.windSpeed} m/s</p>
                        </div>
                    )}
                </div>
            )}
        </div>
    );
}

export default FlightForm;
